// Navbar.jsx
import React from 'react';
import './NavbarHome.css';
// Importez vos images (assurez-vous qu'elles sont dans le dossier src/assets)
import userImage from './logo512.png';
import logoImage from  './logo512.png';
import mapIcon from  './logo512.png';

const NavbarHome = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <div className="user-info">
          <img src={userImage} alt="User" className="user-image" />
          <div className="user-details">
            <span className="navbar-name">Morgan M.</span>
            <div className="badges">
              <span className="badge silver">Silver</span>
              <span className="badge major">Major</span>
              <span className="badge exclusive">Exclusive</span>
            </div>
          </div>
        </div>
      </div>
      
      <div className="navbar-center">
        <div className="logo-container">
          <img src={logoImage} alt="BEVOBO Logo" className="navbar-logo" />
        </div>
      </div>
      
      <div className="navbar-right">
        <button className="map-button">
          <img src={mapIcon} alt="Map" className="map-icon" />
          <span>MAP</span>
        </button>
      </div>
    </nav>
  );
};

export default NavbarHome;
